import React from "react";
import {easeOut, motion} from "framer-motion"

const ballstyle={
    display: 'block',
    width: '1rem',
    height:'1rem',
    backgroundColor:'black',
    borderRadius: ".5rem",
}

const bounceTransition={
    y: {
        duration: 0.4,
        yoyo: Infinity,
        ease: "easeOut"
    },
}

export default function Ball(){
    return(
        <motion.span style={ballstyle} transition={bounceTransition} animate={{
            y:['100%','-100%']
        }}/>
    )
}
